  false,\n\t\"url\": null,\n\t\"notes\": \"This final environmental assessment is
  for the use of livestock grazing to improve the quality of wildlife habitats within
  the Silver Dollar Habitat Unit on Charles M. Russell National Wildlife Refuge.  Livestock,
  in some portions of the Unit, remove a large portion of the annual production of
  the plant communities, reducing or eliminating cover and foods for wildlife. Current
  management of this unit is not meeting the compatibility standard required by legislation.
  \ No action and no grazing have been proposed, but the preferred alternative is
  prescriptive grazing and adaptive management.\",\n\t\"license_title\": \"License
